import data, { Cairns } from './data.js';

function App() {
  return (
    <div className="App">

      <hr />
      <div> 
        <Cards
          cities={data}
        />
      </div>
      <hr />
      <div>
        <SearchBar
          onSearch={(ciudad) => alert(ciudad)}
        />
      </div>
    </div>
  );
}

export default App;
